import { Box, Button, Tab, Tabs, TextField, Toolbar, Typography } from "@mui/material";
import React, { useEffect, useState } from "react";
import { Link, NavLink } from "react-router-dom";

import "./css/Home.css";
import "./Item/Item.css";
import axios from "axios";
import Item from "./Item/Item";
const URL = "http://localhost:5000/items";

const fetchHandler = async() => {
  
   return await axios.get(URL).then((res)=> res.data);
};
const Home = () => {
  const [value,setValue] = useState();
  const [items, setItems] = useState();
  useEffect(() => {
     fetchHandler().then((data) => setItems(data.items));
  }, []);
  console.log(items);

  
  return  (
    

    <div>
    <div className='top-tittle'>




    <div>
        <AppBar sx={{ backgroundColor: "#1E0046" }} position="sticky">
            <Toolbar>
                <NavLink to="/" style={{color:"white"}}>
                
                <div> <a href = "/"> <img src = {logo}/> </a></div>
            
                </NavLink>
                     <Tabs 
                        sx={{ml:'auto'}}
                textColor="inherit" 
                indicatorColor="secondar" 
                value={value} 
                onChange={(e,val)=>setValue(val)}>

                    <Tab LinkComponent={NavLink} to="/add" label="Add item"/>
                    <Tab LinkComponent={NavLink} to="/Items" label="Services"/>
                    <Tab LinkComponent={NavLink} to="/about" label=" HIBERNATED"/>
                </Tabs>
            </Toolbar> 
           
        </AppBar>
    </div>
      
   

    





    <div className='side-tittle'>
    </div>  </div>

    <div class="sidebar"> 
    <p style={{color:'white',marginLeft:50}}>
            Admin Panel
        </p>
        <a href="" className='active'>Service Management</a>
        <a href="">Shedule</a>
        <a href="">Homework</a>
        <a href="" >Customer Support</a>
        <a href="">Employee Management</a>
        <a href="">User Management</a>
        <a href="">Setting</a>
    </div> 



    <br/>

    <div>
     <ul>
        {items &&  
         items.map((item, i) => (
            <li key={i}>
              <Item item={item} />
           </li>
       ))}
      </ul>
  </div>
    
</div>
  

  
  );
};

export default Home;
